#coding: utf-8
from urllib import quote




s=''
len=len(s)
p=''
for i in range(len)[::2]:
    p+=quote(chr(int(s[i:i+2],16)))
    #print(p)

#If url browser access needs to be encoded again, curl can directly access
urlp = quote(p)
urlp = 'gopher://127.0.0.1:80/_' + urlp
print(urlp)
